		console.log(this.props.data[0]);

		return (
			<div>
				<p>
					Instructor: {this.props.data.instructor}
          		</p>
				<p>
					Instructor: {this.props.data.instructor}
          		</p>
				<p>
					Instructor: {this.props.data.instructor}
          		</p>
				<Subsection data={this.props.data[0].subsections}/>
				<br></br>
			</div>
		)
	}
}

export default Section;
